import httpClient from "../http-common2";
import httpClient1 from "../http-common-3";

// const create = (data) => {
//   return httpClient.post("/security/user/b/i", data);
// };

const getAll = () => {
  return httpClient.get("/security/admin/t");
};

  const update = (data) => {
    return httpClient.put("/security/user/updateBooking", data);
  };
const create = (data) => {
  return httpClient.post("/security/user/b/i", data);
};
const remove = (id) => {
  return httpClient.delete(`/security/user/delete/booking/${id}`);
};
const get = (id) => {
  return httpClient1.get(`/bookingdetails/ga/${id}`);
};
const createTicket = (data) => {
  return httpClient1.post("/ticket/i", data);
};
const getbookingdetails = (emailId) => {
  return httpClient1.get(`/ticket/ga/fullBookingDetails/${emailId}`);
};
const getticketbyemailId = (emailId) => {
  return httpClient1.get(`/ticket/ga/fullBookingDetails/${emailId}`);
};

export default {
  getAll,
  update,
  create,
  remove,
  get,
  createTicket,
  getbookingdetails,
  getticketbyemailId,
};
